$$.control.registerControl("rootPage",{template:'<div>\n    <section>\n        <h2>Password</h2>\n        <div>\n            <button class="w3-button w3-blue" bn-event="click: onChangePwd">Change Password</button>\n        </div>    \n    </section>\n\n    <section>\n        <h2>Music</h2>\n        <div>\n            <button class="w3-button w3-blue" bn-event="click: onGenerateMusicDb">Generate Database</button>\n        </div>    \n    </section>\n</div>',deps:["breizbot.users","breizbot.songs"],init:function(n,e,t){const o=$$.ui.waitDialog("Generating...");$$.viewController(n,{data:{},events:{onChangePwd:async function(){const n=await $$.ui.showPrompt({title:"Change Password",label:"New Password:"});if(console.log("newPwd",n),null!=n)try{await e.changePwd(n),$$.ui.showAlert({title:"Change Password",content:"Password has been changed"})}catch(n){$$.ui.showAlert({title:"Error",content:n.responseText})}},onGenerateMusicDb:async function(){o.show(),await t.generateDb(),o.hide()}}})}});